package com.maomao.ssm.pojo;

import java.io.Serializable;
import java.util.Date;

/**
 * 质押,常规,自营页面需要的数据
 * @author Administrator
 *
 */
public class GoodsWithBLOBsList implements Serializable{
	private Integer goodsId;
	private String goodsName;
	private Integer categoryId;
	private Long priceSales;
	private Integer stock;
	private Integer stockSham;
	private byte type;
	private Byte status;
	private Date limitTime;
	private Byte warehouseType;
	public GoodsWithBLOBsList() {
		super();
		// TODO Auto-generated constructor stub
	}
	public GoodsWithBLOBsList(Integer goodsId, String goodsName, Integer categoryId, Long priceSales, Integer stock,
			Integer stockSham, byte type, Byte status, Date limitTime, Byte warehouseType) {
		super();
		this.goodsId = goodsId;
		this.goodsName = goodsName;
		this.categoryId = categoryId;
		this.priceSales = priceSales;
		this.stock = stock;
		this.stockSham = stockSham;
		this.type = type;
		this.status = status;
		this.limitTime = limitTime;
		this.warehouseType = warehouseType;
	}
	public Integer getGoodsId() {
		return goodsId;
	}
	public void setGoodsId(Integer goodsId) {
		this.goodsId = goodsId;
	}
	public String getGoodsName() {
		return goodsName;
	}
	public void setGoodsName(String goodsName) {
		this.goodsName = goodsName;
	}
	public Integer getCategoryId() {
		return categoryId;
	}
	public void setCategoryId(Integer categoryId) {
		this.categoryId = categoryId;
	}
	public Long getPriceSales() {
		return priceSales;
	}
	public void setPriceSales(Long priceSales) {
		this.priceSales = priceSales;
	}
	public Integer getStock() {
		return stock;
	}
	public void setStock(Integer stock) {
		this.stock = stock;
	}
	public Integer getStockSham() {
		return stockSham;
	}
	public void setStockSham(Integer stockSham) {
		this.stockSham = stockSham;
	}
	public byte getType() {
		return type;
	}
	public void setType(byte type) {
		this.type = type;
	}
	public Byte getStatus() {
		return status;
	}
	public void setStatus(Byte status) {
		this.status = status;
	}
	public Date getLimitTime() {
		return limitTime;
	}
	public void setLimitTime(Date limitTime) {
		this.limitTime = limitTime;
	}
	public Byte getWarehouseType() {
		return warehouseType;
	}
	public void setWarehouseType(Byte warehouseType) {
		this.warehouseType = warehouseType;
	}
}
